import React from "react";
import "./Documentation.css";

const Documentation = () => {
  return (
    <div className="documentation">
      <h1>Документация</h1>
      <p>
        Добро пожаловать в документацию проекта! Здесь вы найдёте подробные инструкции
        по настройке, использованию и решению технических вопросов.
      </p>
    </div>
  );
};

export default Documentation;
